import { Form, Col, Container, Media } from "react-bootstrap";

const subscribe = () => {
  return (
    <div>
      <Container style={{ textAlign: "center" }}>
        <h1>Subscribe</h1>
        <Form.Row>
          <Col>
            <Form.Control type="text" placeholder="Name" />
          </Col>

          <Col>
            <Form.Control type="text" placeholder="email" />
          </Col>
        </Form.Row>
      </Container>
    </div>
  );
};

export default subscribe;
